import React from 'react';
import './Card.css';

var front = true;

function Flip() {
    front = !front;
    console.log(front);
};


const Card = (props) => {
    var frontButton = (<button className="card-button"><b>LEARN MORE</b></button>);
    var backButton = (<button className="card-button"><b>CLOSE</b></button>);
    frontButton.onClick = function() {Flip()};
    backButton.onClick = function() {Flip()};

    if (front) {
        return (
            <div className="card">
                <div style={{
                textAlign: "center",
                marginInline: "10%"
            }}>
                    <h3>
                        {props.title}
                    </h3>
                </div>  
                <div style={{
                    textAlign: "center"
                }}>
                    {frontButton}
                </div>

            </div>
        );
    } else {
        return (
            <div className="card">
                <div style={{
                textAlign: "center",
                marginInline: "10%"
            }}>
                    <p>
                        {props.info}
                    </p>
                </div>  
                <div style={{
                textAlign: "center"
            }}>
                    {backButton}
                </div>

            </div>
        );
    }
};

export default Card;
